INSERT INTO `products` VALUES (1,'Shower','2025-09-07 03:23:26.590702','Benefits\r\nBe Nice Shower Cream gently cleanses, keeps skin soft, moisturized, and radiant with a refreshing long-lasting fragrance.\r\n\r\nStorage\r\nStore in a cool, dry place away from sunlight. Close cap tightly after use.\r\n\r\nUnit\r\n1 bottle (450–500 ml)\r\n\r\nSeller\r\nBe Nice / Official retailers\r\n\r\nDisclaimer\r\nImages are for reference only. Please check packaging for exact details.','Be Nice Shower Cream, Perfect Elastic Formula, 450 ml.',109,108,'In stock',NULL),(2,'Snack','2025-09-07 03:30:54.870859','มันฝรั่งทอดกรอบ Lay’s รส Original ความกรอบอร่อยในทุกคำ ผลิตจากมันฝรั่งคุณภาพดี ผ่านกระบวนการผลิตที่สะอาดและได้มาตรฐาน เหมาะสำหรับเป็นของว่างหรือทานคู่กับอาหารจานโปรด.','Lay\'s Classic Potato Chips',35,132,'In stock',NULL),(3,'Food & Drink','2025-09-07 03:32:51.272481','Coca-Cola ขวดใหญ่ 1.5 ลิตร เติมเต็มความสดชื่นในทุกโอกาส รสชาติหวานซ่าเป็นเอกลักษณ์ที่อยู่คู่คนทั่วโลกมานานกว่า 100 ปี ดื่มเย็นๆ ยิ่งอร่อยและช่วยให้กระปรี้กระเปร่า.','Coca-Cola 1.5L',25,66,'In stock',NULL),(4,'SmartPhone','2025-09-07 03:34:41.806738','iPhone 14 Pro มาพร้อมชิป A16 Bionic อันทรงพลังและดีไซน์ใหม่ Dynamic Island กล้องความละเอียดสูงที่ช่วยถ่ายภาพได้อย่างคมชัดทั้งกลางวันและกลางคืน ตัวเครื่องทำจากวัสดุคุณภาพที่ทั้งสวยงามและทนทาน.','iPhone 14 Pro',38900,38,'In stock',NULL),(5,'SmartPhone','2025-09-07 03:36:37.963312','สมาร์ทโฟนเรือธงจาก Samsung ที่มีกล้อง 200MP ถ่ายภาพได้ละเอียดคมชัด มาพร้อมปากกา S Pen สำหรับจดบันทึกและวาดรูป หน้าจอ Dynamic AMOLED 2X ให้ภาพสดใสและการตอบสนองที่ลื่นไหล.','Samsung Galaxy S23 Ultra',35900,78,'In stock',NULL),(6,'Furniture','2025-09-07 03:38:49.697992','เก้าอี้สำนักงานออกแบบตามหลักสรีรศาสตร์ มีระบบปรับระดับได้หลายทิศทางและรองรับหลังอย่างเต็มที่ เบาะนั่งทำจากวัสดุคุณภาพนั่งสบาย สามารถใช้ได้นานโดยไม่ปวดเมื่อย.','Office Chair Ergonomic',4500,63,'In stock',NULL),(7,'Furniture','2025-09-07 03:41:21.091241','โต๊ะทานอาหารไม้เนื้อแข็งสำหรับ 6 ที่นั่ง แข็งแรงทนทาน ดีไซน์คลาสสิคเข้ากับ