สชาติหวานมัน ตัวช็อกโกแลตหุ้มถั่วลิสงด้านใน เพิ่มความกรุบกรอบ สนุกสนานในการทาน พกพาสะดวก เหมาะสำหรับทานเล่นระหว่างวัน งานปาร์ตี้ หรือเป็นของว่างระหว่างเรียนและทำงาน ผลิตด้วยช็อกโกแลตคุณภาพสูงและสีธรรมชาติ','M&M\'s Peanut Chocolate 45 g',30,50,'In stock',NULL),(16,'Food & Drink','2025-09-07 07:09:14.520707','Nescafé Blend & Brew 3 in 1 กาแฟสำเร็จรูปพร้อมดื่ม 20 ซอง มีส่วนผสมของกาแฟ, น้ำตาล และครีมเทียม ให้รสชาติเข้มข้น หอมกลมกล่อม ทานง่ายทุกเวลา เหมาะสำหรับคนที่เร่งรีบหรือชอบดื่มกาแฟแบบสะดวกสบาย เพียงฉีกซอง เติมน้ำร้อนก็พร้อมดื่มทันที พกพาสะดวก เหมาะสำหรับทำงาน เรียน หรือพักผ่อน','Nescafé Blend & Brew 3 in 1 Instant Coffee 20 Sticks',120,63,'In stock',NULL),(203,'Food & Drink','2025-10-23 03:11:28.238892','hrhrd','bsfbgs',45,47,'In stock',NULL);
